import { useState } from "react";
import '../navbar.css'
import Logout from './Logout'

const Navbar = ({username, eraseAuth}) => {

    return (

    <nav className='navbar'> 
            <Logout className='f4 fw6 db blue no-underline underline-hover' username={username} eraseAuth={eraseAuth} className='logout_button'/>
    </nav>
);
};

export default Navbar;
